
// 3225. Maximum Score From Grid Operations
// https://leetcode.com/problems/maximum-score-from-grid-operations/





class Solution {
private:
    long long mem1[102][100];
    long long mem2[102][100];
    long long mem3[102][102][100];
    long long prefixSum[102][100];

    int n;

    long long rec(int prepre, int pre, int j) {
        // cout << "rec prepre " << prepre << " pre " << pre << " j " << j << endl;
        if( j == n )
            return 0LL;

        // pre:    smallest white row in column j-1
        // prepre: smallest white row in column j-2
        // let i be the 1st row we are leaving white in our current column
        // case: i < pre                    : we count sum[i,pre-1][j]
        // case: i >= pre && prepre <= pre  : we count sum[pre,i][j-1]
        // case: i >= pre && prepre > pre   : we count sum[prepre,i][j-1]

        if( mem3[prepre][pre][j] != -1 )
            return mem3[prepre][pre][j];

        long long ret = 0LL;

        long long t = 0LL;

        int i = 0;

        // prepre does not matter as long as i < pre
        if( mem1[pre][j] != -1 ) {
            ret = mem1[pre][j];
            i = pre;
        } else {
            for(; i < pre; ++i) {
                t = prefixSum[pre][j] - prefixSum[i][j];
                ret = max(ret, t + rec(pre,i,j+1));
            }
            mem1[pre][j] = ret;
        }

        // prepre does further not matter if prepre <= pre
        if( prepre <= pre ) {
            if( mem2[pre][j] != -1 ) {
               ret = mem2[pre][j];

            } else {
                for(; i <= n; ++i) {
                    t = j == 0 ? 0 : prefixSum[i][j-1] - prefixSum[pre][j-1];
                    ret = max(ret, t + rec(pre,i,j+1));
                }
                mem2[pre][j] = ret;
            }
        } else {
            for(; i <= n; ++i) {
                t = 0LL;
                if( prepre < i )
                    t = j == 0 ? 0 : prefixSum[i][j-1] - prefixSum[prepre][j-1];
                ret = max(ret, t + rec(pre,i,j+1));
            }
        }

        /*
        for(; i <= n; ++i) {
            t = 0LL;
            if( prepre <= pre ) {
                t = j == 0 ? 0 : prefixSum[i][j-1] - prefixSum[pre][j-1];
            } else if( prepre < i ) {
                t = j == 0 ? 0 : prefixSum[i][j-1] - prefixSum[prepre][j-1];
            }
            ret = max(ret, t + rec(pre,i,j+1));
        } */
        // cout << "rec prepre " << prepre << " pre " << pre << " j " << j << " result " << ret << endl;
        return mem3[prepre][pre][j] = ret;
    }


public:
    long long maximumScore(vector<vector<int>>& grid) {
        n = grid.size(); // n x n grid, 1 <= n <= 100
        if( n == 1 )
            return 0LL;

        memset(prefixSum,0,sizeof prefixSum);
        for(int i = 1; i <= n; ++i) {       // row
            for(int j = 0; j < n; ++j) {    // column
                prefixSum[i][j] = prefixSum[i-1][j] + grid[i-1][j];
            }
        }

        memset(mem1,-1,sizeof mem1);
        memset(mem2,-1,sizeof mem2);
        memset(mem3,-1,sizeof mem3);

        return rec(0,0,0);
    }
};



